function generate(e,t){"generateCircle"==t?generateCircle(e):"generateRainbow"==t&&generateRainbow(e)}function generateCircle(e){var t=e.getContext("2d");t.save(),t.fillStyle="black",t.fillRect(0,0,e.width,e.height);for(var a=0;a<300;a++){var r=Math.floor(Math.random()*e.width),l=Math.floor(Math.random()*e.height),o=Math.floor(Math.random()*Math.min(e.width,e.height)/20),h=Math.floor(255*Math.random()),n=Math.floor(255*Math.random()),i=Math.floor(255*Math.random());t.beginPath(),t.arc(r,l,o,2*Math.PI,0,!1),t.fillStyle="rgba("+h+","+n+","+i+",1)",t.fill(),t.closePath()}t.restore()}function generateRainbow(e){var t=e.getContext("2d");t.save(),t.fillStyle="black",t.fillRect(0,0,e.width,e.height);var a=["red","orange","yellow","green","blue","indigo","violet"];shuffleArray(a);for(var r=t.createLinearGradient(0,0,e.width,0),l=0;l<a.length;l++)r.addColorStop(l/(a.length-1),a[l]);t.fillStyle=r,t.fillRect(0,0,e.width,e.height),t.restore()}function shuffleArray(e){for(var t=e.length-1;t>0;t--){var a=Math.floor(Math.random()*(t+1)),r=e[t];e[t]=e[a],e[a]=r}}
